import React,{Component} from 'react';
import TopNavLeftIcon from './TopNavLiftIcon';



class TopNavLeft extends Component {
    
    render() {

        const LeftIcon = [
        {className:"fab fa-facebook-f", href:"https://www.facebook.com/", title:"Facebook"},
        {className:"fab fa-google-plus-g", href:"https://plus.google.com/", title:"Google+"},
        {className:"fab fa-twitter", href: "https://twitter.com", title:"Twitter"},
        {className:"fab fa-linkedin-in", href:"https://www.linkedin.com", title:"LinkedIn"},
        {className:"fab fa-instagram", href:"https://www.instagram.com", title:"instagram"},
        ]
        
        const members =LeftIcon.map(function (member) {
            return
            <TopNavLeftIcon
                className={member.className}
                href={member.href}
                title={member.title}
                    />
        })
        return (
            <div className=" col-lg-6 col-md-6 col-sm-12 col-xs-12">
                <ul className="list-inline hover-red">
                 
                    {members}
                    {members}
                    {members}
                    {members}
                    {members}
                    
                </ul>
            </div>
        )
    };
}
export default TopNavLeft;
